import { Switch as RSwitch} from 'react-router-dom';



function Switch({ fallback, children, includeNotFound = true, ...others }) {
  return (
    <Suspense fallback={<WaitLayout/>}>
      <RSwitch {...others}>
        {children}
        {/*{includeNotFound && <Redirect from="*" to="/404" />}*/}
      </RSwitch>
    </Suspense>
  );
}

export default memo(Switch);
